import React from "react";
import { StyledToggleSwtich } from "./styles/ToggleSwitch.styled";

function ToggleSwitch({isToggled, onToggle, registerName}) {
  return (

    <StyledToggleSwtich>
    <label className="switch">
      <input type="checkbox" checked={isToggled} onChange={onToggle} registerName={registerName} />
      <span className="slider round"></span>
    </label>
    </StyledToggleSwtich>
  );
}
export default ToggleSwitch;
